Jack Cross (01 - 04) (2005 - 2006) (DCP) 


The abruptly canceled Jack Cross series. Original planned as an ongoing series and just stopped at 4 issue, with no reason mentioned why.  Just Warren Ellis saying that there will be no more Jack Cross stories. When the reprint was slated for release Ellis would comment again on his blog &quot;JACK CROSS was a disappointment, a project that went wrong fast and seemed to be outside my reach to fix. Gary did a yeoman job on these four issues, but thereÃ¢â‚¬â„¢ll never be any more.&quot;  

No one but Ellis and DC Comics really knows what happened and why Jack Cross only lasted four issues which we collected in DC Comics Presents: Jack Cross
